import React from 'react'

function Card(props) {
  return (
    <div style={{backgroundImage:`url(${props.img}) `, backgroundSize:"cover", backgroundPosition:"center"}} className="category-card d-flex flex-column justify-content-end p-3">
      <h4>{props.title}</h4>
      <p>{props.desc}</p>
    </div>
  )
}

export default Card
